INSERT INTO `v3_helps` VALUES ('3', '1', '会员特权', '0', '<p style=\"margin-top: 0px; margin-bottom: 0px; line-height: 21px; font-size: 14px; color: rgb(31, 31, 31); font-family: -apple-system, BlinkMacSystemFont, &quot;Helvetica Neue&quot;, Helvetica, &quot;Segoe UI&quot;, Arial, Roboto, &quot;PingFang SC&quot;, miui, &quot;Hiragino Sans GB&quot;, &quot;Microsoft Yahei&quot;, sans-serif; text-wrap: wrap; background-color: rgb(245, 245, 245);\">您好，</p><p style=\"margin-top: 0px; margin-bottom: 0px; line-height: 21px; font-size: 14px; color: rgb(31, 31, 31); font-family: -apple-system, BlinkMacSystemFont, &quot;Helvetica Neue&quot;, Helvetica, &quot;Segoe UI&quot;, Arial, Roboto, &quot;PingFang SC&quot;, miui, &quot;Hiragino Sans GB&quot;, &quot;Microsoft Yahei&quot;, sans-serif; text-wrap: wrap; background-color: rgb(245, 245, 245);\">会员特权请点击【<span class=\"editor-href\" style=\"margin: 0px; line-height: 24px; color: rgb(78, 110, 242);\">会员中心</span>】查看。</p><p style=\"margin-top: 0px; margin-bottom: 0px; line-height: 21px; font-size: 14px; color: rgb(31, 31, 31); font-family: -apple-system, BlinkMacSystemFont, &quot;Helvetica Neue&quot;, Helvetica, &quot;Segoe UI&quot;, Arial, Roboto, &quot;PingFang SC&quot;, miui, &quot;Hiragino Sans GB&quot;, &quot;Microsoft Yahei&quot;, sans-serif; text-wrap: wrap; background-color: rgb(245, 245, 245);\">感谢您对云网盘的支持！</p><p><br/></p>', '0', '0', '0', '0', '1688552449', '1688548741');
INSERT INTO `v3_helps` VALUES ('4', '1', '查看订阅的分享', '0', '<p style=\"margin-top: 0px; margin-bottom: 0px; line-height: 21px; font-size: 14px; color: rgb(31, 31, 31); font-family: -apple-system, BlinkMacSystemFont, &quot;Helvetica Neue&quot;, Helvetica, &quot;Segoe UI&quot;, Arial, Roboto, &quot;PingFang SC&quot;, miui, &quot;Hiragino Sans GB&quot;, &quot;Microsoft Yahei&quot;, sans-serif; text-wrap: wrap; background-color: rgb(245, 245, 245);\">您好，</p><p style=\"margin-top: 0px; margin-bottom: 0px; line-height: 21px; font-size: 14px; color: rgb(31, 31, 31); font-family: -apple-system, BlinkMacSystemFont, &quot;Helvetica Neue&quot;, Helvetica, &quot;Segoe UI&quot;, Arial, Roboto, &quot;PingFang SC&quot;, miui, &quot;Hiragino Sans GB&quot;, &quot;Microsoft Yahei&quot;, sans-serif; text-wrap: wrap; background-color: rgb(245, 245, 245);\">订阅的链接暂时不支持在电脑端查看，&nbsp;您可在手机端网盘App【共享】-【订阅的分享】内查看。</p><p style=\"margin-top: 0px; margin-bottom: 0px; line-height: 21px; font-size: 14px; color: rgb(31, 31, 31); font-family: -apple-system, BlinkMacSystemFont, &quot;Helvetica Neue&quot;, Helvetica, &quot;Segoe UI&quot;, Arial, Roboto, &quot;PingFang SC&quot;, miui, &quot;Hiragino Sans GB&quot;, &quot;Microsoft Yahei&quot;, sans-serif; text-wrap: wrap; background-color: rgb(245, 245, 245);\">感谢您对云网盘的支持！</p><p><br/></p>', '0', '0', '0', '0', '1688548797', '1688548797');
INSERT INTO `v3_helps` VALUES ('2', '1', '下载无法调起客户端', '0', '<p style=\"margin-top: 0px; margin-bottom: 0px; line-height: 21px; font-size: 14px; color: rgb(31, 31, 31); font-family: -apple-system, BlinkMacSystemFont, &quot;Helvetica Neue&quot;, Helvetica, &quot;Segoe UI&quot;, Arial, Roboto, &quot;PingFang SC&quot;, miui, &quot;Hiragino Sans GB&quot;, &quot;Microsoft Yahei&quot;, sans-serif; text-wrap: wrap; background-color: rgb(245, 245, 245);\">您好，</p><p style=\"margin-top: 0px; margin-bottom: 0px; line-height: 21px; font-size: 14px; color: rgb(31, 31, 31); font-family: -apple-system, BlinkMacSystemFont, &quot;Helvetica Neue&quot;, Helvetica, &quot;Segoe UI&quot;, Arial, Roboto, &quot;PingFang SC&quot;, miui, &quot;Hiragino Sans GB&quot;, &quot;Microsoft Yahei&quot;, sans-serif; text-wrap: wrap; background-color: rgb(245, 245, 245);\">请您按照下面步骤操作:&nbsp;&nbsp;&nbsp;</p><p style=\"margin-top: 0px; margin-bottom: 0px; line-height: 21px; font-size: 14px; color: rgb(31, 31, 31); font-family: -apple-system, BlinkMacSystemFont, &quot;Helvetica Neue&quot;, Helvetica, &quot;Segoe UI&quot;, Arial, Roboto, &quot;PingFang SC&quot;, miui, &quot;Hiragino Sans GB&quot;, &quot;Microsoft Yahei&quot;, sans-serif; text-wrap: wrap; background-color: rgb(245, 245, 245);\">1、chrome的需要点一下右上角的允许使用或在地址栏输入&nbsp;chrome://flags/#enable-npapi&nbsp;后回车&nbsp;，把“将NPAPI设为有效”开启，重启浏览器即可。</p><p style=\"margin-top: 0px; margin-bottom: 0px; line-height: 21px; font-size: 14px; color: rgb(31, 31, 31); font-family: -apple-system, BlinkMacSystemFont, &quot;Helvetica Neue&quot;, Helvetica, &quot;Segoe UI&quot;, Arial, Roboto, &quot;PingFang SC&quot;, miui, &quot;Hiragino Sans GB&quot;, &quot;Microsoft Yahei&quot;, sans-serif; text-wrap: wrap; background-color: rgb(245, 245, 245);\">2、IE浏览器相应弹窗点击“允许”。</p><p style=\"margin-top: 0px; margin-bottom: 0px; line-height: 21px; font-size: 14px; color: rgb(31, 31, 31); font-family: -apple-system, BlinkMacSystemFont, &quot;Helvetica Neue&quot;, Helvetica, &quot;Segoe UI&quot;, Arial, Roboto, &quot;PingFang SC&quot;, miui, &quot;Hiragino Sans GB&quot;, &quot;Microsoft Yahei&quot;, sans-serif; text-wrap: wrap; background-color: rgb(245, 245, 245);\">3、其它浏览器请在“工具”里面检查是否禁用了“百度网盘客户端”插件。</p><p><br/></p>', '0', '0', '0', '0', '1688548526', '1688546429');
