INSERT INTO `v3_sys_logs` VALUES ('1892', 'UPDATED', '134', 'logs.help.edit', '{\"help_id\":2,\"type\":1,\"title\":\"下载无法调起客户端\",\"parent_id\":0,\"content\":\"<p style=\\\"margin-top: 0px; margin-bottom: 0px; line-height: 21px; font-size: 14px; color: rgb(31, 31, 31); font-family: -apple-system, BlinkMacSystemFont, &quot;Helvetica Neue&quot;, Helvetica, &quot;Segoe UI&quot;, Arial, Roboto, &quot;PingFang SC&quot;, miui, &quot;Hiragino Sans GB&quot;, &quot;Microsoft Yahei&quot;, sans-serif; text-wrap: wrap; background-color: rgb(245, 245, 245);\\\">您好，<\\/p><p style=\\\"margin-top: 0px; margin-bottom: 0px; line-height: 21px; font-size: 14px; color: rgb(31, 31, 31); font-family: -apple-system, BlinkMacSystemFont, &quot;Helvetica Neue&quot;, Helvetica, &quot;Segoe UI&quot;, Arial, Roboto, &quot;PingFang SC&quot;, miui, &quot;Hiragino Sans GB&quot;, &quot;Microsoft Yahei&quot;, sans-serif; text-wrap: wrap; background-color: rgb(245, 245, 245);\\\">请您按照下面步骤操作:&nbsp;&nbsp;&nbsp;<\\/p><p style=\\\"margin-top: 0px; margin-bottom: 0px; line-height: 21px; font-size: 14px; color: rgb(31, 31, 31); font-family: -apple-system, BlinkMacSystemFont, &quot;Helvetica Neue&quot;, Helvetica, &quot;Segoe UI&quot;, Arial, Roboto, &quot;PingFang SC&quot;, miui, &quot;Hiragino Sans GB&quot;, &quot;Microsoft Yahei&quot;, sans-serif; text-wrap: wrap; background-color: rgb(245, 245, 245);\\\">1、chrome的需要点一下右上角的允许使用或在地址栏输入&nbsp;chrome:\\/\\/flags\\/#enable-npapi&nbsp;后回车&nbsp;，把“将NPAPI设为有效”开启，重启浏览器即可。<\\/p><p style=\\\"margin-top: 0px; margin-bottom: 0px; line-height: 21px; font-size: 14px; color: rgb(31, 31, 31); font-family: -apple-system, BlinkMacSystemFont, &quot;Helvetica Neue&quot;, Helvetica, &quot;Segoe UI&quot;, Arial, Roboto, &quot;PingFang SC&quot;, miui, &quot;Hiragino Sans GB&quot;, &quot;Microsoft Yahei&quot;, sans-serif; text-wrap: wrap; background-color: rgb(245, 245, 245);\\\">2、IE浏览器相应弹窗点击“允许”。<\\/p><p style=\\\"margin-top: 0px; margin-bottom: 0px; line-height: 21px; font-size: 14px; color: rgb(31, 31, 31); font-family: -apple-system, BlinkMacSystemFont, &quot;Helvetica Neue&quot;, Helvetica, &quot;Segoe UI&quot;, Arial, Roboto, &quot;PingFang SC&quot;, miui, &quot;Hiragino Sans GB&quot;, &quot;Microsoft Yahei&quot;, sans-serif; text-wrap: wrap; background-color: rgb(245, 245, 245);\\\">3、其它浏览器请在“工具”里面检查是否禁用了“百度网盘客户端”插件。<\\/p><p><br\\/><\\/p>\",\"likes\":0,\"nolikes\":0,\"update_time\":\"2023-07-05 16:40:29\",\"create_time\":\"2023-07-05 16:40:29\",\"keywords\":[{\"id\":1,\"keyword\":\"BBB\",\"help_id\":2},{\"id\":2,\"keyword\":\"AAA\",\"help_id\":2}],\"username\":\"admin\",\"realname\":\"S7\",\"ip\":\"127.0.0.1\"}', '1688548393');
