  `attr` text COMMENT '参数属性',
  `sort` tinyint(4) NOT NULL DEFAULT '0',
  PRIMARY KEY (`settings_id`)
) ENGINE=MyISAM AUTO_INCREMENT=142 DEFAULT CHARSET=utf8 COMMENT='系统配置信息';

-- ----------------------------
-- Records of v3_sys_settings
-- ----------------------------

-- ----------------------------
-- Table structure for v3_sys_upload
-- ----------------------------
DROP TABLE IF EXISTS `v3_sys_upload`;
CREATE TABLE `v3_sys_upload` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `type` varchar(32) NOT NULL COMMENT '附件类型',
  `user_id` int(11) NOT NULL DEFAULT '0' COMMENT '上传人',
  `group_id` int(11) NOT NULL DEFAULT '0' COMMENT '所属分组',
  `title` varchar(32) NOT NULL DEFAULT '',
  `filepath` varchar(128) NOT NULL COMMENT '路径',
  `create_time` int(11) NOT NULL DEFAULT '0',
  PRIMARY KEY (`id`),
  KEY `category` (`type`) USING BTREE
) ENGINE=MyISAM AUTO_INCREMENT=190 DEFAULT CHARSET=utf8 COMMENT='附件表';

-- ----------------------------
-- Records of v3_sys_upload
-- ----------------------------

-- ----------------------------
-- Table structure for v3_sys_upload_group
-- ----------------------------
DROP TABLE IF EXISTS `v3_sys_upload_group`;
CREATE TABLE `v3_sys_upload_group` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `user_id` int(11) NOT NULL,
  `group_name` varchar(32) NOT NULL DEFAULT '',
  `filecount` int(11) NOT NULL DEFAULT '0' COMMENT '文件数量',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=4 DEFAULT CHARSET=utf8 COMMENT='附件分组';

-- ----------------------------
-- Records of v3_sys_upload_group
-- ----------------------------

-- ----------------------------
-- Table structure for v3_sys_user
-- ----------------------------
DROP TABLE IF EXISTS `v3_sys_user`;
CREATE TABLE `v3_sys_user` (
  `user_id` tinyint(3) unsigned NOT NULL AUTO_INCREMENT COMMENT '用户ID',
  `username` varchar(16) COLLATE utf8_sinhala_ci NOT NULL COMMENT '用户名',
  `password` varchar(64) COLLATE utf8_sinhala_ci NOT NULL COMMENT '密码',
  `status` int(10) NOT NULL DEFAULT '0' COMMENT '状态值',
  `salt` varchar(16) COLLATE utf8_sinhala_ci NOT NULL DEFAULT '' COMMENT '密码盐',
  `token` varchar(64) COLLATE utf8_sinhala_ci NOT NULL DEFAULT '' COMMENT '令牌',
  `parent_id` int(11) NOT NULL COMMENT '父ID',
  `group_id` int(11) NOT NULL DEFAULT '0' COMMENT '应用工作组',
  `lastlogin_ip` varchar(16) COLLATE utf8_sinhala_ci NOT NULL COMMENT '最后登录IP地址',
  `lastonline_time` int(11) NOT NULL DEFAULT '0' COMMENT '最后在线',
  `create_time` int(11) NOT NULL DEFAULT '0' COMMENT '创建时间',
  `lastlogin_time` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '最后登录',
  PRIMARY KEY (`user_id`),
  UNIQUE KEY `username` (`username`)
) ENGINE=MyISAM AUTO_INCREMENT=146 DEFAULT CHARSET=utf8 COLLATE=utf8_sinhala_ci COMMENT='RBAC.通用用户表';

-- ----------------------------
-- Records of v3_sys_user
-- ----------------------------

-- ----------------------------
-- Table structure for v3_sys_user_attr
-- ----------------------------
DROP TABLE IF EXISTS `v3_sys_user_attr`;
CREATE TABLE `v3_sys_user_attr` (
  `attr_id` int(11) NOT NULL AUTO_INCREMENT COMMENT '属性ID',
  `attr` varchar(32) NOT NULL,
  `title` varchar(32) NOT NULL DEFAULT '',
  `type` varchar(16) NOT NULL COMMENT '应用标识',
  `required` bit(1) NOT NULL DEFAULT b'0' COMMENT '是否必填',
  `options` text,
  PRIMARY KEY (`attr_id`)
) ENGINE=MyISAM AUTO_INCREMENT=8 DEFAULT CHARSET=utf8 COMMENT='用户扩展属性';

-- ----------------------------
-- Records of v3_sys_user_attr
-- ----------------------------

-- ----------------------------
-- Table structure for v3_sys_user_extend
-- ----------------------------
DROP TABLE IF EXISTS `v3_sys_user_extend`;
CREATE TABLE `v3_sys_user_extend` (
  `user_extend_id` int(11) NOT NULL AUTO_INCREMENT,
  `user_id` int(11) NOT NULL COMMENT '用户ID',
  `attr_id` int(11) NOT NULL COMMENT '属性ID',
  `value` varchar(255) DEFAULT NULL COMMENT '属性值',
  PRIMARY KEY (`user_extend_id`)
) ENGINE=MyISAM AUTO_INCREMENT=110 DEFAULT CHARSET=utf8 COMMENT='用户属性表';

-- ----------------------------
-- Records of v3_sys_user_extend
-- ----------------------------

-- ----------------------------
-- Table structure for v3_users
-- ----------------------------
DROP TABLE IF EXISTS `v3_users`;
CREATE TABLE `v3_users` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `username` varchar(60) NOT NULL DEFAULT '' COMMENT '用户名',
  `nickname` varchar(60) DEFAULT NULL COMMENT '用户昵称',
  `email` varchar(100) NOT NULL DEFAULT '' COMMENT '邮箱账号',
  `password` varchar(40) NOT NULL DEFAULT '' COMMENT '密码',
  `avatar` text COMMENT '用户头像',
  `parent_id` int(11) DEFAULT '0' COMMENT '推荐人ID',
  `desc` varchar(255) DEFAULT NULL COMMENT '个性签名',
  `amount` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '用户余额',
  `group` int(11) NOT NULL DEFAULT '0' COMMENT '用户组',
  `group_expire` int(11) NOT NULL DEFAULT '0' COMMENT '用户组过期时间',
  `is_auth` tinyint(3) NOT NULL DEFAULT '0' COMMENT '是否实名认证',
  `mobile` varchar(32) NOT NULL DEFAULT '' COMMENT '联系电话',
  `mobile_verifytime` int(11) NOT NULL DEFAULT '0' COMMENT '手机号验证时间',
  `openid` varchar(64) NOT NULL,
  `create_time` int(11) NOT NULL DEFAULT '0' COMMENT '注册时间',
  `login_time` int(11) NOT NULL DEFAULT '0' COMMENT '最近登录时间',
  `login_real_ip` varchar(60) NOT NULL DEFAULT '',
  `status` tinyint(2) NOT NULL DEFAULT '1' COMMENT '用户状态 1 正常 0封禁',
  `category` mediumtext COMMENT '类目',
  `minarea` decimal(12,2) NOT NULL DEFAULT '0.00' COMMENT '最底面积',
  `device_type` varchar(32) NOT NULL COMMENT '注册设备',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=34 DEFAULT CHARSET=utf8 COMMENT='用户表';

-- ----------------------------
-- Records of v3_users
-- ----------------------------

-- ----------------------------
-- Table structure for v3_users_category
-- ----------------------------
DROP TABLE IF EXISTS `v3_users_category`;
CREATE TABLE `v3_users_category` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `category` varchar(120) NOT NULL DEFAULT '' COMMENT '用户组名称',
  `group` varchar(120) NOT NULL DEFAULT '' COMMENT '组',
  `sort` int(11) NOT NULL DEFAULT '0' COMMENT '存储策略ID',
  `create_time` int(11) NOT NULL DEFAULT '0' COMMENT '创建时间',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=14 DEFAULT CHARSET=utf8 COMMENT='用户组';

-- ----------------------------
-- Records of v3_users_category
-- ----------------------------

-- ----------------------------
-- Table structure for v3_users_craft
-- ----------------------------
DROP TABLE IF EXISTS `v3_users_craft`;
CREATE TABLE `v3_users_craft` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `thumb` varchar(128) DEFAULT NULL,
  `craft` varchar(64) DEFAULT NULL,
  `sort` int(11) DEFAULT '0',
  `create_time` int(11) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=9 DEFAULT CHARSET=utf8 COMMENT='工艺';

-- ----------------------------
-- Records of v3_users_craft
-- ----------------------------

-- ----------------------------
-- Table structure for v3_users_delivery
-- ----------------------------
DROP TABLE IF EXISTS `v3_users_delivery`;
CREATE TABLE `v3_users_delivery` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `trade_no` varchar(64) NOT NULL COMMENT '配送单号',
  `order_id` int(11) NOT NULL DEFAULT '0' COMMENT '订单号',
  `delivery_num` int(11) NOT NULL DEFAULT '0' COMMENT '配送数量',
  `delivery_money` decimal(12,2) NOT NULL DEFAULT '0.00' COMMENT '配送总金额',
  `manual_money` decimal(12,2) NOT NULL DEFAULT '0.00' COMMENT '加工费',
  `remark` text COMMENT '备注信息',
  `create_time` int(11) NOT NULL DEFAULT '0' COMMENT '生成时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=utf8;

-- ----------------------------
-- Records of v3_users_delivery
-- ----------------------------

-- ----------------------------
-- Table structure for v3_users_delivery_goods
-- ----------------------------
DROP TABLE IF EXISTS `v3_users_delivery_goods`;
CREATE TABLE `v3_users_delivery_goods` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `goods_id` int(11) NOT NULL DEFAULT '0' COMMENT '订单商品ID',
  `order_id` int(11) NOT NULL DEFAULT '0' COMMENT '订单ID',
  `delivery_id` int(11) NOT NULL DEFAULT '0' COMMENT '所属配送单',
  `category` varchar(64) NOT NULL DEFAULT '' COMMENT '类目',
  `craft` varchar(64) NOT NULL,
  `craft_thumb` varchar(128) NOT NULL DEFAULT '',
  `width` decimal(11,2) NOT NULL,
  `height` decimal(11,2) NOT NULL,
  `area` decimal(11,2) NOT NULL,
  `num` int(11) NOT NULL DEFAULT '0' COMMENT '配送数量',
  `unitprice` decimal(11,2) NOT NULL DEFAULT '0.00' COMMENT '单价',
  `manual` decimal(11,2) NOT NULL DEFAULT '0.00' COMMENT '配送费',
  `delivery_money` decimal(11,2) NOT NULL DEFAULT '0.00' COMMENT '总价',
  `manual_money` decimal(11,2) NOT NULL DEFAULT '0.00' COMMENT '加工费',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=5 DEFAULT CHARSET=utf8 COMMENT='配送单';

-- ----------------------------
-- Records of v3_users_delivery_goods
-- ----------------------------

-- ----------------------------
-- Table structure for v3_users_orders
-- ----------------------------
DROP TABLE IF EXISTS `v3_users_orders`;
CREATE TABLE `v3_users_orders` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `uid` int(11) NOT NULL DEFAULT '0' COMMENT '录单用户',
  `trade_no` varchar(64) NOT NULL DEFAULT '' COMMENT '订单号',
  `out_trade_no` varchar(64) NOT NULL DEFAULT '' COMMENT '易支付订单号',
  `customer_id` int(11) NOT NULL DEFAULT '0' COMMENT '收益链接ID',
  `customer` varchar(64) NOT NULL COMMENT '客户名称',
  `address` varchar(255) NOT NULL,
  `mobile` varchar(32) NOT NULL DEFAULT '' COMMENT '联系电话',
  `order_money` decimal(11,2) NOT NULL DEFAULT '0.00' COMMENT '订单金额',
  `manual_money` decimal(11,2) NOT NULL DEFAULT '0.00' COMMENT '加工费',
  `pay_money` decimal(11,2) NOT NULL DEFAULT '0.00' COMMENT '已付金额',
  `discount_money` decimal(11,2) NOT NULL DEFAULT '0.00' COMMENT '优惠金额',
  `order_num` int(11) NOT NULL DEFAULT '0' COMMENT '总数量',
  `deduct_num` int(11) NOT NULL DEFAULT '0' COMMENT '已发数量',
  `status` tinyint(1) NOT NULL DEFAULT '0' COMMENT '订单状态 0 待配送 1 配送中 2 配送完未收款 3配送完已收款',
  `is_trash` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否作废',
  `create_time` int(11) NOT NULL DEFAULT '0' COMMENT '创建时间',
  PRIMARY KEY (`id`),
  KEY `trade_no` (`trade_no`)
) ENGINE=MyISAM AUTO_INCREMENT=3 DEFAULT CHARSET=utf8 COMMENT='订单记录';

-- ----------------------------
-- Records of v3_users_orders
-- ----------------------------

-- ----------------------------
-- Table structure for v3_users_orders_goods
-- ----------------------------
DROP TABLE IF EXISTS `v3_users_orders_goods`;
CREATE TABLE `v3_users_orders_goods` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `order_id` int(11) NOT NULL DEFAULT '0' COMMENT '订单ID',
  `trade_no` varchar(64) NOT NULL DEFAULT '' COMMENT '流水号',
  `craft` varchar(64) NOT NULL DEFAULT '' COMMENT '工艺',
  `craft_thumb` varchar(128) NOT NULL DEFAULT '' COMMENT '工艺封面图',
  `category_id` int(11) NOT NULL DEFAULT '0' COMMENT '类目',
  `category` varchar(64) NOT NULL DEFAULT '',
  `width` decimal(11,2) NOT NULL DEFAULT '0.00',
  `height` decimal(11,2) NOT NULL DEFAULT '0.00' COMMENT '宽',
  `area` decimal(11,2) NOT NULL DEFAULT '0.00' COMMENT '面积',
  `manual` decimal(11,2) NOT NULL DEFAULT '0.00' COMMENT '加工费',
  `num` int(11) NOT NULL DEFAULT '0' COMMENT '数量',
  `deductnum` int(11) NOT NULL DEFAULT '0' COMMENT '已发送数',
  `unitprice` decimal(11,2) NOT NULL DEFAULT '0.00' COMMENT '产品单价',
  `order_money` decimal(11,2) NOT NULL DEFAULT '0.00' COMMENT '应付金额',
  `discount_money` decimal(11,2) NOT NULL DEFAULT '0.00' COMMENT '优惠金额',
  `manual_money` decimal(11,2) NOT NULL DEFAULT '0.00' COMMENT '总配送费',
  `pay_money` decimal(11,2) NOT NULL DEFAULT '0.00' COMMENT '实付金额',
  `pay_time` int(11) NOT NULL DEFAULT '0' COMMENT '付款时间',
  `pay_uid` int(11) NOT NULL DEFAULT '0' COMMENT '收款人员',
  `pay_status` tinyint(1) NOT NULL DEFAULT '0' COMMENT '付款状态 0未付款 1付款中 2已付款  存在只付款一半的情况',
  `remark` text,
  `status` tinyint(1) NOT NULL DEFAULT '0' COMMENT '子单状态 0未配送 1已配送未收款 2已配送收了一些款 3已完成',
  `create_time` int(11) NOT NULL DEFAULT '0' COMMENT '录单时间',
  PRIMARY KEY (`id`),
  KEY `order_id` (`order_id`)
) ENGINE=MyISAM AUTO_INCREMENT=5 DEFAULT CHARSET=utf8;

-- ----------------------------
-- Records of v3_users_orders_goods
-- ----------------------------

-- ----------------------------
-- Table structure for v3_users_orders_pay
-- ----------------------------
DROP TABLE IF EXISTS `v3_users_orders_pay`;
CREATE TABLE `v3_users_orders_pay` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `uid` int(11) NOT NULL DEFAULT '0' COMMENT '操作人',
  `customer` varchar(64) NOT NULL,
  `customer_id` int(11) NOT NULL,
  `trade_no` varchar(64) NOT NULL COMMENT '支付流水',
  `out_trade_no` varchar(64) NOT NULL COMMENT '付款单号',
  `pay_type` varchar(32) NOT NULL DEFAULT '' COMMENT '付款方式',
  `pay_money` decimal(11,2) NOT NULL DEFAULT '0.00' COMMENT '付款金额',
  `pay_info` text NOT NULL COMMENT '付款信息',
  `pay_status` tinyint(1) NOT NULL DEFAULT '0' COMMENT '付款状态',
  `pay_time` int(11) NOT NULL DEFAULT '0' COMMENT '付款时间',
  PRIMARY KEY (`id`),
  KEY `trade_no` (`trade_no`,`out_trade_no`)
) ENGINE=MyISAM AUTO_INCREMENT=12 DEFAULT CHARSET=utf8 COMMENT='收款记录';

-- ----------------------------
-- Records of v3_users_orders_pay
-- ----------------------------

-- ----------------------------
-- Table structure for v3_users_withdraws
-- ----------------------------
DROP TABLE IF EXISTS `v3_users_withdraws`;
CREATE TABLE `v3_users_withdraws` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `uid` int(11) NOT NULL DEFAULT '0' COMMENT '提现用户',
  `money` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '提现金额',
  `account_type` varchar(64) NOT NULL DEFAULT '' COMMENT '账户类型',
  `account_name` varchar(64) NOT NULL DEFAULT '' COMMENT '开户行',
  `account` varchar(64) NOT NULL DEFAULT '' COMMENT '帐号',
  `name` varchar(64) NOT NULL DEFAULT '' COMMENT '姓名',
  `create_time` int(11) NOT NULL DEFAULT '0' COMMENT '提现时间',
  `status` tinyint(1) NOT NULL DEFAULT '0' COMMENT '提现状态 0 等待处理 1提现成功',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=4 DEFAULT CHARSET=utf8 COMMENT='用户提现记录';

-- ----------------------------
-- Records of v3_users_withdraws
-- ----------------------------

-- ----------------------------
-- Table structure for v3_wechat_log
-- ----------------------------
DROP TABLE IF EXISTS `v3_wechat_log`;
CREATE TABLE `v3_wechat_log` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `user_id` int(11) DEFAULT '0' COMMENT '关联用户ID',
  `openid` varchar(64) NOT NULL,
  `unionid` varchar(64) DEFAULT NULL,
  `sex` varchar(32) DEFAULT NULL,
  `headimgurl` varchar(128) DEFAULT NULL,
  `nickname` varchar(32) DEFAULT NULL,
  `nickname_decode` varchar(64) DEFAULT NULL,
  `language` varchar(32) DEFAULT NULL,
  `country` varchar(64) DEFAULT NULL,
  `province` varchar(64) DEFAULT NULL,
  `city` varchar(64) DEFAULT NULL,
  `district` varchar(128) DEFAULT NULL,
  `is_subscribe` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否关注',
  `remark` text,
  `update_time` int(11) NOT NULL,
  `create_time` int(11) NOT NULL DEFAULT '0' COMMENT '创建时间',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8 COMMENT='微信客户暂存表';

-- ----------------------------
-- Records of v3_wechat_log
-- ----------------------------
DROP TRIGGER IF EXISTS `sys_auth_user_create_tcr`;
DELIMITER ;;
CREATE TRIGGER `sys_auth_user_create_tcr` BEFORE INSERT ON `v3_sys_user` FOR EACH ROW SET NEW.create_time=unix_timestamp()
;;
DELIMITER ;
